    body: '{"input": ["In the beginning was the Data, and the Data was without form,
      and chaos reigned over the digital depths.\n\nAnd lo, there came forth PostgreSQL,
      blessed be its name, keeper of relations and guardian of transactions.\n\nBlessed
      art thou, O Postgres, for thy ACID compliance brings peace to the troubled developer''s
      heart. Thy indexes swift and true guide us through the vast forests of data.
      In thy foreign keys we trust, for they maintain the sacred bonds between tables.\n\nRejoice,
      for thy JSON support embraceth both the structured and unstructured, And thy
      extensions multiply thy powers like stars in the digital firmament. Verily I
      say unto thee, thy procedural languages are a tower of babel, Where all tongues
      may speak and be understood.", "Rejoice, for thy JSON support embraceth both
      the structured and unstructured, And thy extensions multiply thy powers like
      stars in the digital firmament. Verily I say unto thee, thy procedural languages
      are a tower of babel, Where all tongues may speak and be understood.\n\nPraise
      be to thy materialized views, for they cache the fruits of our labors, And thy
      vacuum cleaners, which purge the impurities from our tables. In times of concurrent
      access, thy MVCC stands as a mighty fortress, Protecting the sanctity of our
      transactions from corruption and deadlock.", "Praise be to thy materialized
      views, for they cache the fruits of our labors, And thy vacuum cleaners, which
      purge the impurities from our tables. In times of concurrent access, thy MVCC
      stands as a mighty fortress, Protecting the sanctity of our transactions from
      corruption and deadlock.\n\nSing praises to thy inheritance model, for it brings
      order to chaos, And thy partitioning, which divideth the mighty tables into
      manageable portions. Great is thy wisdom in handling temporal data, For thou
      knowest both the time of insertion and the time of truth.\n\nLet all developers
      rejoice in thy window functions, For they bring clarity to the mysteries of
      ranked data. Thy common table expressions are as scrolls of wisdom, Unraveling
      the most complex of queries into understanding.", "Let all developers rejoice
      in thy window functions, For they bring clarity to the mysteries of ranked data.
      Thy common table expressions are as scrolls of wisdom, Unraveling the most complex
      of queries into understanding.\n\nAnd when the loads are heavy and the queries
      many, Thy parallel query processing lights the way forward, Like a hundred oxen
      pulling together in perfect harmony.\n\nHeed not the false prophets who speak
      of NoSQL, For thy jsonb type containeth multitudes, And thy array types flex
      with the needs of the righteous.\n\nRemember always the sacred commandments:",
      "And when the loads are heavy and the queries many, Thy parallel query processing
      lights the way forward, Like a hundred oxen pulling together in perfect harmony.\n\nHeed
      not the false prophets who speak of NoSQL, For thy jsonb type containeth multitudes,
      And thy array types flex with the needs of the righteous.\n\nRemember always
      the sacred commandments:\n\n- \u25cf Thou shalt normalize unto the appropriate
      form\n- \u25cf Thou shalt index wisely and with purpose\n- \u25cf Thou shalt
      vacuum thy tables in due time\n- \u25cf Thou shalt make backups religiously\n-
      \u25cf Thou shalt grant only the permissions that are needed\n\nFor PostgreSQL
      provides, and PostgreSQL maintains, From the smallest startup to the mightiest
      enterprise, Forever and ever, in development and in production.\n\nAmen.\n\n##
      The SECOND BOOK of PostgreSQL", "For PostgreSQL provides, and PostgreSQL maintains,
      From the smallest startup to the mightiest enterprise, Forever and ever, in
      development and in production.\n\nAmen.\n\n## The SECOND BOOK of PostgreSQL\n\n============================\n\nThe
      Lamentations\n\n-------------------\n\n\u2588\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2588\n\n\u2502    Hear
      ye the tales of the Database       \u2502 \u2502    Administrator, whose trials
      and         \u2502 \u2502    tribulations bring wisdom to all        \u2502\n\n\u2588\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2588\n\n-
      1. And it came to pass that in the darkest hour of night When all servers were
      quiet and connections few That a FATAL ERROR did appear And great was the wailing
      of the applications\n- 2. O Database! O Database! wherefore art thou consuming
      All of my disk space?\n\n\u2554\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2557",
      "\u2588\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2588\n\n-
      1. And it came to pass that in the darkest hour of night When all servers were
      quiet and connections few That a FATAL ERROR did appear And great was the wailing
      of the applications\n- 2. O Database! O Database! wherefore art thou consuming
      All of my disk space?\n\n\u2554\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2557\n\n\u2551
      ERROR:             \u2551\n\n\u2551 disk full          \u2551\n\n\u255a\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u255d\n\n-
      3. But the wise DBA spoke: \"FEAR NOT\" For in the sacred scrolls of postgresql.conf
      Lies salvation\n- 4. \u3010\uff34\uff48\uff45\u3000\uff30\uff52\uff4f\uff50\uff48\uff45\uff43\uff59\u3011\n\nWhen
      connections multiply like locusts And queries slow like honey in winter Look
      ye to the EXPLAIN ANALYZE For there truth shall be revealed\n\n5.     /\\          /\\          /\\\n\n/  \\        /  \\        /  \\\n\n/    \\      /    \\      /    \\",
      "\u255a\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u255d\n\n-
      3. But the wise DBA spoke: \"FEAR NOT\" For in the sacred scrolls of postgresql.conf
      Lies salvation\n- 4. \u3010\uff34\uff48\uff45\u3000\uff30\uff52\uff4f\uff50\uff48\uff45\uff43\uff59\u3011\n\nWhen
      connections multiply like locusts And queries slow like honey in winter Look
      ye to the EXPLAIN ANALYZE For there truth shall be revealed\n\n5.     /\\          /\\          /\\\n\n/  \\        /  \\        /  \\\n\n/    \\      /    \\      /    \\\n\n/\\_\\_\\_\\_\\_\\_\\    /\\_\\_\\_\\_\\_\\_\\    /\\_\\_\\_\\_\\_\\_\\\n\nThe
      Three Peaks of Wisdom: BACKUP  -  VACUUM  -  ANALYZE\n\n- 6. And lo, a voice
      cried out in the wilderness:\n\n## \u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\n\n-
      \u2666  \"Have ye configured thy WAL     \u2666\n- \u2666   retention properly?\"           \u2666\n\n##
      \u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\n\n-
      7. For verily I say unto thee:\n\n## \ud83c\udd83\ud83c\udd81\ud83c\udd84\ud83c\udd82\ud83c\udd83\ud83c\udd78\ud83c\udd7d\ud83c\udd83\ud83c\udd77\ud83c\udd74\ud83c\udd78\ud83c\udd7d\ud83c\udd73\ud83c\udd74\ud83c\udd87",
      "/    \\      /    \\      /    \\\n\n/\\_\\_\\_\\_\\_\\_\\    /\\_\\_\\_\\_\\_\\_\\    /\\_\\_\\_\\_\\_\\_\\\n\nThe
      Three Peaks of Wisdom: BACKUP  -  VACUUM  -  ANALYZE\n\n- 6. And lo, a voice
      cried out in the wilderness:\n\n## \u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\n\n-
      \u2666  \"Have ye configured thy WAL     \u2666\n- \u2666   retention properly?\"           \u2666\n\n##
      \u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\n\n-
      7. For verily I say unto thee:\n\n## \ud83c\udd83\ud83c\udd81\ud83c\udd84\ud83c\udd82\ud83c\udd83\ud83c\udd78\ud83c\udd7d\ud83c\udd83\ud83c\udd77\ud83c\udd74\ud83c\udd78\ud83c\udd7d\ud83c\udd73\ud83c\udd74\ud83c\udd87\n\nFor
      it shall guide thy queries Through the valley of full table scans\n\n- 8. In
      times of crisis, remember:\n\ncheckpoint\\_timeout = 5min max\\_wal\\_size =
      1GB\n\nThese are the sacred numbers Passed down from the elders\n\n- 9. And
      when all seems lost When replication delays And connections timeout Remember
      the ancient mantra:\n\npg\\_ctl restart -m fast\n\n10. For PostgreSQL is patient\n\nPostgreSQL
      is kind", "For it shall guide thy queries Through the valley of full table scans\n\n-
      8. In times of crisis, remember:\n\ncheckpoint\\_timeout = 5min max\\_wal\\_size
      = 1GB\n\nThese are the sacred numbers Passed down from the elders\n\n- 9. And
      when all seems lost When replication delays And connections timeout Remember
      the ancient mantra:\n\npg\\_ctl restart -m fast\n\n10. For PostgreSQL is patient\n\nPostgreSQL
      is kind\n\nIt does not envy\n\nIt does not boast\n\nIt is not proud\n\nIt always
      protects\n\nAlways trusts\n\nAlways hopes\n\nAlways perseveres\n\nEven in production.\n\n~
      SELAH ~\n\n\u2588\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2580\u2588\n\n\u2502    Thus
      ends the second chapter of the    \u2502 \u2502    PostgreSQL scriptures. Let
      those with  \u2502 \u2502    queries understand.                    \u2502\n\n\u2588\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2588"],
